<li>
<p>使用按键<code>e</code>中断启动加载程序</p>
</li>
<li>
<p>光标移动至linux行，使用按键<code>ctrl+e</code>跳转至末尾，输入<code>rd.break console=tty0</code>，通过按键<code>ctrl+x</code>继续启动系统</p>
